    <div className="Box">
      <h1>Skills</h1>
      <label htmlFor="">
        Name :
        <input type="string" />
      </label>
      <br /> <br />
      <button onclick={handleSubmit}>Submit</button>
    </div>
  );
}

export default Skill;
